  console.log(courses);

  return (
    <section className="courses">
      <div className="container">
        <p>Курсы валют:</p>
          <div>
          {courses.map(item => (
          <CoursesItem key={item} {...item} />
          ))}
          </div>
      </div>
    </section>
  );
}

export { Courses };
